import React from "react";
import image from "../../../assets/images/header_curve.svg";

const About = () => {
  return (
    <div>
      <div
        style={{
          backgroundImage: "url(" + image + ")",
          backgroundRepeat: "no-repeat",
          backgroundSize: "cover",
        }}
      ></div>
    </div>
  );
};

export default About;
